    display: block;
    position: relative;
    width: 40px;
    height: 30px;
    cursor: pointer;
    z-index:10;

    &:before,
    &:after {
      content:'';
    position: absolute;
    background-color: $primary-color;
    opacity: .50;
    border-radius: 4px;
    height: 10%;
    width: 100%;
    left:0;
    transition: all 0.3s ease;
    z-index: 5;
    }
    &:before {
      top:0;
    }
    &:after {
      bottom: 0;
    }
    &.mobile:before {
      transform: rotate(45deg);
      top:13px;
    }
    &.mobile:after {
      transform: rotate(-45deg);
      bottom: 13px;
    }
  }
  &__lines {
  position: absolute;
  background-color:$primary-color;
  opacity: .50;
  border-radius: 4px;
  top:14px;
  left:0;
  height: 10%;
  width: 100%;
  transition: all 0.3s ease;

  &.mobile {
    transform: scale(0);
  }
  }
}

