.input {
  border: 1px solid $primary-color;
  opacity: 0.25;
}
.text-field {
  height: 44px;
  width: 100%;
  border-radius: $main-border-rad;
  padding: 0 35px 0 13px;
  font-family: $mainFont;
  font-weight: 400;
  line-height: 18px;

  &:hover,
  &:focus {
    opacity: 0.5;
    color: $primary-color;
  }
