  @include visually-hidden;
  border-radius: 10px;
  &:active {
    border: $second-color;
  }
}

.checkbox input [type="checkbox"]{
  @include visually-hidden;
  border-radius:$main-border-rad;
  &:active {
    border: $second-color;
  }
}

.toggle {
  width: 40px;
  height: 20px;
  border-radius: 10px;
  &:active {
    border: $second-color;
  }
}

