    position: absolute;
    right:15px;
    top: 18px;
    &:active {
      opacity: .8;
      transform: translateY(3px);
      transform: translateY(3px);
    }
  }
  &-label {
    @include h3Style;
    display: block;
    margin-top: 104px;
  }
}

